import {React, useState, useEffect } from 'react';
import { useNavigate } from "react-router-dom";
import axios from "axios";
import './Register.css';
import {
  Button,
  Checkbox,
  Form,
  Input,
  DatePicker,
  Select,
} from 'antd';
const { Option } = Select;
const formItemLayout = {
  labelCol: {
    xs: {
      span: 24,
    },
    sm: {
      span: 8,
    },
  },
  wrapperCol: {
    xs: {
      span: 24,
    },
    sm: {
      span: 16,
    },
  },
};
const tailFormItemLayout = {
  wrapperCol: {
    xs: {
      span: 24,
      offset: 0,
    },
    sm: {
      span: 16,
      offset: 8,
    },
  },
};

function Register() {
  const [user, setUser] = useState({
    email: "",
    password: "",
    rePassword: "",
    name: "",
    residence: "",
    phone: "",
    birthday: "",
    gender: "",
  });
  const [errors, setErrors] = useState({});
  const navigate = useNavigate();
  const handleInputChange = (event) => {
    const { name, value } = event.target;
    setUser((prevData) => ({ ...prevData, [name]: value }));
  };
  const handleSubmit = (event) => {
    event.preventDefault();
    axios
      .post("http://localhost:8000/users", {
        email: user.email,
        password: user.password,
        name: user.name,
        phone: user.phone,
        birthday: user.birthday,
        gender: user.gender,
        isLogin: false,
      })
      .then((response) => {
        console.log("Đăng ký thành công:", response.data);
        navigate("/login");
      })
      .catch((error) => {
        console.error("Đăng ký lỗi:", error);
        // Handle registration error if necessary
      });
  };
  const [form] = Form.useForm();
  const onFinish = (values) => {
    console.log('Received values of form: ', values);
  };
  const prefixSelector = (
    <Form.Item name="prefix" noStyle>
      <Select
        style={{
          width: 70,
        }}
      >
        <Option value="86">+84</Option>

      </Select>
    </Form.Item>
  );

  const [autoCompleteResult, setAutoCompleteResult] = useState([]);
  const onWebsiteChange = (value) => {
    if (!value) {
      setAutoCompleteResult([]);
    } else {
      setAutoCompleteResult(['.com', '.org', '.net'].map((domain) => `${value}${domain}`));
    }
  };
  const websiteOptions = autoCompleteResult.map((website) => ({
    label: website,
    value: website,
  }));
  return (
    <div>
      <div className='RegisterNavbar'>TOP/ ログイン</div>
       <div className='RegisterPage1'>新規会員登録</div>
       <div className='RegisterPage2'>
       <Form
      {...formItemLayout}
      form={form}
      name="register"
      onFinish={onFinish}
      onSubmit={handleSubmit}

      style={{
        maxWidth: 600,
      }}
      scrollToFirstError
    >
      <Form.Item
        name="email"
        label="メール"
        rules={[
          {
            type: 'email',
            message: '入力された電子メールは無効です。',
          },
          {
            required: true,
            message: 'メールアドレスを入力してください。',
          },
        ]}
      >
        <Input 
        type='text'
        name='email'
        value={user.email}
        onChange={handleInputChange}/>
          {errors.email && <div className='error'>{errors.email}</div>}
      </Form.Item>

      <Form.Item
        name="password"
        label="パスワード"
        rules={[
          {
            required: true,
            message: 'パスワードを入力してください。',
          },
        ]}
        hasFeedback
      >
        <Input.Password 
        type='password'
        name='password'
        value={user.password}
        onChange={handleInputChange}/>
      </Form.Item>



      <Form.Item
        name="name"
        label="名前"

        rules={[
          {
            required: true,
            message: 'あなたの名前を入力してください！',
            whitespace: true,
          },
        ]}
      >
        <Input type='name'
        name='name'
        value={user.name}
        onChange={handleInputChange}/>
      </Form.Item>



      <Form.Item
        name="phone"
        label="電話番号"
        rules={[
          {
            required: true,
            message: '電話番号を入力してください!',
          },
        ]}
      >
        <Input
          type='phone'
          name='phone'
          value={user.phone}
          onChange={handleInputChange}
          addonBefore={prefixSelector}
          style={{
            width: '100%',
          }}
        />
      </Form.Item>
      <Form.Item
      name="birthday"A
      label="誕生日"
      rules={[
        {
          required: true,
          message: '誕生日を選択してください!',
        },
      ]}>
        <DatePicker 
        type='birthday'
        name='birthday'
        value={user.birthday}
        onChange={handleInputChange}

        style={{
            width: '100%',
          }}/>
      </Form.Item>




      <Form.Item
        name="gender"
        label="性別"
        rules={[
          {
            required: true,
            message: '性別を選択してください!',
          },
        ]}
      >
        <Select 
        type='gender'
        name='gender'
        value={user.gender}
        onChange={handleInputChange}
        placeholder="select your gender">
          <Option value="male">男</Option>
          <Option value="female">女</Option>
          <Option value="other">他</Option>
        </Select>
      </Form.Item>



      <Form.Item
        name="agreement"
        valuePropName="checked"
        rules={[
          {
            validator: (_, value) =>
              value ? Promise.resolve() : Promise.reject(new Error('Should accept agreement')),
          },
        ]}
        {...tailFormItemLayout}
      >
        <Checkbox>
        はい、オファーやスタイルアップデート、セールやイベントへの特別招待の受信を希望します。
        </Checkbox>
      </Form.Item>
      <Form.Item {...tailFormItemLayout}>
        <Button type="primary" htmlType="submit">
        登録
        </Button>
      </Form.Item>
    </Form>
     <div className='RegisterPage2-2'><img src="https://japan.tommy.com/assets/images/member/card.png" alt="" />
     <img src="https://japan.tommy.com/assets/images/mytommy/mytommy.png" alt="" /></div>

       </div>

    </div>
  )
}

export default Register
